CREATE TABLE juros(
   codigo           INTEGER  NOT NULL PRIMARY KEY 
  ,data             DATE 
  ,juros            NUMERIC(6,4)
  ,juros_acumulados NUMERIC(8,4)
  ,tipo             INTEGER 
  ,descricao        VARCHAR(198)
  ,                 VARCHAR(30)
  ,                 VARCHAR(30)
  ,                 VARCHAR(30)
);
